SELECT (COUNT(*) as ?num_uncovered_immunization)
WHERE {
    SERVICE <urn:healthcare-api:ImmunizationByPayer> {
        OPTIONAL {
            ?imm cvx:hasTargetDisease ?immTarget
        }
        ?imm ?prop ?val
        ?payer ?prop ?val
        FILTER (regex(str(?payer), "Aetna"))
        FILTER NOT EXISTS {
            ?imm ?prop ?val
            FILTER (regex(str(?prop), "covered"))
        }
    }
}

