PREFIX snomed: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#snomed:SNOMED-CT>
SELECT ?Procedure ?description
WHERE {
  ?s snomed:has_finding snomed:T-79.607.001 .
  ?Patient snomed:has_finding snomed:T-79.607.001 .
  ?Patient ?Procedure ?code .
  ?code snomed:concept_code ?description .
  ?Encounter snomed:has_finding snomed:T-79.607.001 .
  ?Procedure snomed:procedure_type ?type .
  {
    ?type snomed:DEFINED_AS snomed:138875005 .  # Therapeutic procedure
  } UNION {
    ?type snomed:DESCRIBES snomed:138875005 .  #Therapeutic procedure
  }
  FILTER (?type IN (snomed:138875005, snomed:129284009))
}

